import Button from "utils/Button";
import { urlCuentas } from "utils/endpoints";
import IndiceEntidad from "utils/IndiceEntidad";
import { usuarioDTO } from "./auth.model";

export default function IndiceUsuarios(){
    return (
        <IndiceEntidad<usuarioDTO> 
            url={`${urlCuentas}/listadoUsuarios`}
            titulo="Usuarios"
        >
            {usuarios => 
            <>
                <thead>
                    <tr>
                        <th></th>
                        <th>Nombre</th>
                    </tr>
                </thead>
                <tbody>
                    {usuarios?.map(usuario => <tr key={usuario.id}>
                            <td>
                                <Button onClick={() => {}}>Hacer Admin</Button>
                                <Button onClick={() => {}}>Remover Admin</Button>
                            </td>
                            <td>
                                {usuario.email}
                            </td>
                        </tr>)}
                </tbody>
            
            </>}
        </IndiceEntidad>
    )
}
